import React from "react"
import AppBar from "@material-ui/core/AppBar"
import Toolbar from "@material-ui/core/Toolbar"
import Typography from "@material-ui/core/Typography"
import Container from "@material-ui/core/Container"
import Paper from "@material-ui/core/Paper"
import {
  createMuiTheme,
  makeStyles,
  ThemeProvider
} from "@material-ui/core/styles"

import Tasks from "./Tasks"
import './css/gh-fork-ribbon.css';

const theme = createMuiTheme({
  palette: {
    primary: { main: "#0c3fbf" },
    secondary: { main: "#ed8b00" }
  }
})

const useStyles = makeStyles(theme => ({
  logo: {
    marginRight: 20
  },

  appBarSpacer: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    height: "100vh",
    overflow: "auto"
  },
  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4)
  },
  paper: {
    padding: theme.spacing(2),
    display: "flex",
    overflow: "auto",
    flexDirection: "column"
  }
}))

const App: React.FC<{}> = () => {
  const classes = useStyles()
  return (
    <ThemeProvider theme={theme}>
      <AppBar>
        <Toolbar>
          <Typography variant="h3" className={classes.logo}>
            <span role="img" aria-label="img">
             üîç
            </span>
          </Typography>
          <Typography variant="h5">Know-Corona : COVID-19 Question & Answering System</Typography>
        </Toolbar>
      </AppBar>
      <main className={classes.content}>
        <a className="github-fork-ribbon" href="https://github.com/Overfitter/Know-Corona" data-ribbon="Fork me on GitHub" title="Fork me on GitHub">Fork me on GitHub</a>
        <div className={classes.appBarSpacer} />
        <Container className={classes.container}>
          <Paper className={classes.paper}>
            <Tasks />
          </Paper>
        </Container>
      </main>
    </ThemeProvider>
  )
}
export default App
